import React from "react";
import {
  Card,
  CardContent,
  Grid,
  ListItem,
  ListItemText,
} from "@material-ui/core";

const Contacts = ({ contacts }) => {
  return (
    <div>
      <center>
        <h1 style={{ fontSize: 45, color: "grey" }}>CinemaWorld Movies</h1>
      </center>
      <Card>
        <Grid item md={12} xs={12}>
          {contacts.map((item) => {
            return (
              <CardContent>
                <Grid container spacing={3}>
                  <Grid item md={6} xs={12}>
                    <ListItem ContainerComponent="ul">
                      <ListItemText primary={item.Title} />
                    </ListItem>
                  </Grid>
                </Grid>
              </CardContent>
            );
          })}
        </Grid>
      </Card>
    </div>
  );
};

export default Contacts;

